/* nnom model */
static int8_t nnom_input_data[784];
static int8_t nnom_output_data[10];
static nnom_model_t* nnom_model_create(void)
{
	static nnom_model_t model;
	nnom_layer_t* layer[25];

	new_model(&model);

	layer[0] = Input(shape(28, 28, 1), nnom_input_data);
	layer[1] = model.hook(Conv2D(12, kernel(3, 3), stride(1, 1), PADDING_SAME, &conv2d_1_w, &conv2d_1_b), layer[0]);
	layer[2] = model.active(act_relu(), layer[1]);
	layer[3] = model.hook(MaxPool(kernel(2, 2), stride(2, 2), PADDING_SAME), layer[1]);
	layer[4] = model.hook(Conv2D(12, kernel(3, 3), stride(1, 1), PADDING_SAME, &conv2d_2_w, &conv2d_2_b), layer[2]);
	layer[5] = model.hook(UpSample(kernel(2, 2)), layer[3]);
	layer[6] = model.hook(Conv2D(12, kernel(3, 3), stride(1, 1), PADDING_SAME, &conv2d_3_w, &conv2d_3_b), layer[3]);
	layer[7] = model.hook(AvgPool(kernel(2, 2), stride(2, 2), PADDING_SAME), layer[2]);
	layer[8] = model.mergex(Add(ADD_1_OUTPUT_RSHIFT), 2 ,layer[4] ,layer[5]);
	layer[9] = model.mergex(Add(ADD_2_OUTPUT_RSHIFT), 2 ,layer[6] ,layer[7]);
	layer[10] = model.hook(MaxPool(kernel(2, 2), stride(2, 2), PADDING_VALID), layer[8]);
	layer[11] = model.hook(MaxPool(kernel(2, 2), stride(2, 2), PADDING_VALID), layer[9]);
	layer[12] = model.hook(Conv2D(12, kernel(3, 3), stride(1, 1), PADDING_SAME, &conv2d_4_w, &conv2d_4_b), layer[10]);
	layer[13] = model.hook(UpSample(kernel(2, 2)), layer[11]);
	layer[14] = model.mergex(Add(ADD_3_OUTPUT_RSHIFT), 2 ,layer[12] ,layer[13]);
	layer[15] = model.hook(Conv2D(12, kernel(3, 3), stride(1, 1), PADDING_SAME, &conv2d_5_w, &conv2d_5_b), layer[11]);
	layer[16] = model.hook(AvgPool(kernel(2, 2), stride(2, 2), PADDING_SAME), layer[10]);
	layer[17] = model.hook(MaxPool(kernel(2, 2), stride(2, 2), PADDING_VALID), layer[14]);
	layer[18] = model.mergex(Add(ADD_4_OUTPUT_RSHIFT), 2 ,layer[15] ,layer[16]);
	layer[19] = model.mergex(Concat(-1), 2 ,layer[17] ,layer[18]);
	layer[20] = model.hook(Dense(96, &dense_1_w, &dense_1_b), layer[19]);
	layer[21] = model.active(act_relu(), layer[20]);
	layer[22] = model.hook(Dense(10, &dense_2_w, &dense_2_b), layer[21]);
	layer[23] = model.hook(Softmax(), layer[22]);
	layer[24] = model.hook(Output(shape(10,1,1), nnom_output_data), layer[23]);
	model_compile(&model, layer[0], layer[24]);
	return &model;
}
